/*
Navigation Bar.
Also includes "About Us" section.
*/

import React, { Component } from "react";
import "./css/navbar.css";
import "bootstrap/dist/css/bootstrap.css";
import logo from "./img/logo.png";
import { Navbar, Nav } from "react-bootstrap";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
import CourseDescriptionPage from "./CourseDescription";
import SearchResultDisplay from "./ResultDisplay";
import EditCourseDescription from "./EditCourseDescription";

import Compare from "./Compare"

import Timetable from "./Timetable";


if (JSON.parse(localStorage.getItem("timetable")) === null) {
  localStorage.setItem("timetable", JSON.stringify([]));
}

export default class NavbarComp extends Component {
  constructor(props) {
    super(props);
    this.state = {
      username: localStorage.getItem("username"),
      login: false,
    };
  }

  componentDidMount() {
    if (localStorage.getItem("username") !== "") {
      this.setState({ username: localStorage.getItem("username") });
    }
  }

  logOut = () => {
    localStorage.setItem("username", "");
    this.setState({ username: "" });
  };

  getTimeTable = () => {
    return JSON.parse(localStorage.getItem("timetable"));
  };

  deleteTimeTableEntry = () => {};

  render() {
    return (
      <Router>
        <div>
          <Navbar bg="myBlue" variant="dark" sticky="top" expand="lg">
            <Navbar.Brand>
              <img src={logo} alt="" />{" "}
              <Nav.Link href="/" style={{ color: "white", display: "inline" }}>
                Education Pathways
              </Nav.Link>
            </Navbar.Brand>

            <Navbar.Toggle />
            <Navbar.Collapse>
              <Nav>
                <Nav.Link as={Link} to="/about">
                  About Us
                </Nav.Link>

                <Nav.Link as={Link} to="/time_table">
                  Time Table
                  </Nav.Link>


                <Nav.Link as={Link} to="/compare">
                  Compare Courses

                </Nav.Link>

                {/* <Nav.Link href="/search" style={{ color: "white", display: "inline" }}>
                  Search
                </Nav.Link> */}
              </Nav>
            </Navbar.Collapse>
          </Navbar>
        </div>
        <div>
          <Switch>
            <Route path="/about">
              <div className="body_text">
                <p>
                  Welcome to CARTE's in-development tool for course selection at
                  UofT. Education Pathways allows for more intelligent course
                  searching, by matching not just the terms you search, but ones
                  relevant to them. The more terms you search for, the more
                  relevant your results will be! Even try searching across
                  disciplines for the courses that best cover each. Whatever
                  year you are looking for, Education Pathways will also suggest
                  courses in earlier years that will best help you to prepare.
                  To get the most out of this, try searching for courses in a
                  later year and see what is suggested for your current one. We
                  are looking for feedback to improve Education Pathways and
                  make it more useful for students. If you have ideas or
                  suggestions, please{" "}
                  <a href="mailto:alex.olson@utoronto.ca"> email us! </a>{" "}
                  <br></br>
                </p>
                <p>
                  <b>Development Team: </b>
                </p>
                <p>
                  Alexander Olson{" "}
                  <a href="https://carte.utoronto.ca/"> (CARTE)</a>{" "}
                </p>
                <p>
                  Student teams from{" "}
                  <a href="https://shuiblue.github.io/UofT-ECE444/">
                    ECE444 - Software Engineering
                  </a>{" "}
                  :
                </p>
                <p>Fall 2021 - Janelle Cuevas, Jean Lin, Terry Luan, Cansin Varol, Nick Woo</p>
                <p>Fall 2022 - Nissar Ishtiak, Andrew Kim, Abdullah A. Mohammed, Chuanyang Qiao, Gaurav Ranganath</p>
              </div>
              {/* <SearchResultDisplay /> */}
            </Route>
            <Route path="/search">
              <SearchResultDisplay />
            </Route>

            <Route 
            path="/compare"
             
            >
              <Compare></Compare>
              
            </Route>
            

            <Route
              exact
              path="/courseDetails/:id"
              render={(props) => <CourseDescriptionPage {...props} />}
            ></Route>
            <Route path="/time_table">
              <Timetable />
            </Route>
            <Route path="/edit/:id" component={EditCourseDescription}></Route>
            <Route path="/">
              <SearchResultDisplay />
            </Route>
          </Switch>
        </div>
      </Router>
    );
  }
}
